import React, { Component } from 'react';
import '../App.css';
import { Redirect } from 'react-router';
// import Navigationbar from './Navigationbar'
import backGroundImage from "./images/landingPageImage.jpg"
import CustomerCarousel from "./images/yelp_logo.jpg"
import { Carousel, Navbar, Form, Nav, NavDropdown, FormControl, Button, Image } from 'react-bootstrap';


var backgroundImagePic = {
    backgroundImage: `url(${backGroundImage})`, maxWidth: "100%", maxHeight: "100%"
}

class LandingPage extends Component {
    render() {
        return (
            <div style={backgroundImagePic}>
                <div>
                    <Button style = {{margin:"25px 15px", backgroundColor: "transparent", fontSize: "20px", border: 'none', fontWeight: "bold", color: "black"}} variant="link">Write a review</Button> {' '}
                    <Button style = {{margin:"25px 15px", backgroundColor: "transparent", border: 'none', fontSize: "20px", fontWeight: "bold", color: "black", outline: 'none'}} variant='link'> Events</Button> {' '}
                    <Button style = {{margin:"25px 15px", backgroundColor: "transparent", border: 'none', fontSize: "20px", fontWeight: "bold", color: "black", outline: 'none'}} variant='link'> Talk </Button>
                    <Button className="float-right" style={{margin:"25px 15px 25px 850px", backgroundColor: "transparent", fontSize: "20px", fontWeight: "bold", color: "black", border: "1.5px solid white", borderRadius:"5px"}}> Signup </Button>
                    <Button className="float-right" style={{ backgroundColor: "transparent", fontSize: "20px", fontWeight: "bold", color: "black", border: "1.5px solid white", borderRadius:"5px"}}> Login </Button>
                </div>
                    <center>
                        <Image style= {{margin: "200px 50px 25px 50px", width: "25%", height: "20%"}}src={CustomerCarousel}/>
                        {/* <Carousel>
                            <Carousel.Item>
                                <img
                                    className="d-block w-100"
                                    src={CustomerCarousel}
                                    alt="Customer"
                                />
                            </Carousel.Item> */}
                            <Form inline>
                                <FormControl style={{ margin: "0 5px 300px 0", width: "250px", height: "20px"}} type="text" placeholder="restaurants, delivery..." className="mr-sm-2"/>
                                <FormControl style={{width: "200px", height: "20px"}} type='text' placeholder='address..' className="mr-sm-3"/>
                            </Form>
                        {/* </Carousel> */}
                    </center>
            </div>
        )
    }
}

export default LandingPage;
